import React from "react";
import sculptureStudio from "../../assets/studio.sculpture.jpg.JPG";
import drawingStudio from "../../assets/drawingstudio.jpg.JPG";

import "./hero.styles.scss";

const Hero = () => (
  <div className="hero">
    <div className="hero-text">
      <h1>Lofrano Arts</h1>
      <h3>a universal flow of energy and creativity that connects all of us</h3>
    </div>
    <div className="hero-image">
      <img src={sculptureStudio} alt="sculpture-studio" />
      <img src={drawingStudio} alt="drawing-studio" />
    </div>
  </div>
);

export default Hero;
